import React from "react";
import "../stylesheets/Club.scss";

const Club = (props) => {
  const renderMembers = () => {
    props.eachClub.items.map((member) => {
      return <li>{member}</li>;
    });

    return (
      <li className="list__item">
        <i className={`icon ${props.eachClub.fa}`} />
        <div>
          <h2 className="item__title">{props.eachClub.name}</h2>
          <h3>Members:</h3>
          <ul className="item__members">{renderMembers()}</ul>
        </div>
      </li>
    );
  };
};

export default Club;
